namespace Applicacion.Pagos.WebApi.Areas.Job
{
    [DisallowConcurrentExecution]
    public class Job : IJob
    {

        #region Atributes       

        public readonly IFtpFileService ftpFileService;
        public readonly IUnitOfWork unitOfWork;
        public readonly IConfiguration configuration;

        #endregion


        #region Constructor
        public Job( IFtpFileService pFtpFileService, IUnitOfWork pUnitOfWork, IConfiguration pConfiguration)
        {
            unitOfWork = pUnitOfWork;
            ftpFileService = pFtpFileService;
            configuration = pConfiguration;
        }
        #endregion


        #region Methods
        public Task Execute(IJobExecutionContext context)
        {
            ProcessFile processFile = new ProcessFile(new ProcessMulticash(ftpFileService, unitOfWork, configuration));

            processFile.ProcessMulticashFile();
            processFile.ProcessFileOccidente();

            ProcessFile processFileO = new ProcessFile(new ProcessOccidente(ftpFileService, unitOfWork));

            processFileO.ProcessFileOccidente();

            byte[] fileBase64 = Convert.FromBase64String("");
            MemoryStream stream = new MemoryStream(fileBase64);

            //SpreadsheetDocument spreadsheetDocument = SpreadsheetDocument.Open(stream, true);
            //WorkbookPart wbPart = spreadsheetDocument.WorkbookPart;
            //Sheets theSheets = wbPart.Workbook.Sheets;


            using (SpreadsheetDocument doc = SpreadsheetDocument.Open(stream, false))
            {
                WorkbookPart workbookPart = doc.WorkbookPart;
                //SharedStringTablePart sstpart = workbookPart.GetPartsOfType<SharedStringTablePart>().First();
                //SharedStringTable sst = sstpart.SharedStringTable;

                List<WorksheetPart> worksheetPart = workbookPart.WorksheetParts.ToList();

                worksheetPart.ForEach(wsp =>
                {
                    Worksheet sheet = wsp.Worksheet;
                    var cells = sheet.Descendants<Cell>();
                    var rows = sheet.Descendants<Row>();

                    Console.WriteLine("Row count = {0}", rows.LongCount());
                    Console.WriteLine("Cell count = {0}", cells.LongCount());

                    

                    // Or... via each row
                    foreach (Row row in rows)
                    {
                        foreach (Cell c in row.Elements<Cell>())
                        {
                            if (!String.IsNullOrEmpty(c.InnerText))
                            {

                            }
                            Console.WriteLine("Cell contents: {0}", c.CellValue.Text);
                        }
                    }
                });
            }

            return Task.CompletedTask;
        }

        #endregion
    }
}
